					"$$\\chi\t=\t\\frac{\\left(\\left\\langle M^{2}\\right\\rangle -\\left\\langle M\\right\\rangle ^{2}\\right)}{k_{B}T}$$\n",
					"\t\t\n",
					"$$C_{v}\t=\t\\frac{\\left(\\left\\langle E^{2}\\right\\rangle -\\left\\langle E\\right\\rangle ^{2}\\right)}{k_{B}T^{2}}$$"
